                                                                                        <p><i><b>Wilco (The Album)</b></i> is the seventh <a href="/wiki/Studio_album" class="mw-redirect" title="Studio album">studio album</a> by American <a href="/wiki/Alternative_rock" title="Alternative rock">alternative rock</a> group <a href="/wiki/Wilco" title="Wilco">Wilco</a> which was released June 30, 2009. Prior to release, Wilco streamed the album on their website. The album was nominated for a <a href="/wiki/Grammy_Award_for_Best_Americana_Album" title="Grammy Award for Best Americana Album">Grammy Award for Best Americana Album</a>.
                                                                                        </p>
